    return (
      <div className="App">

        <header className="App-header">
          <div className={"container"}>
            <div className={"jumbotron"} id="jumbo">
              <div id="title">VoiNotes</div>
            </div>
            <center><button className="btn btn-primary" style={"opacity: 10%;"} type="submit">Login</button></center>
          </div>
        </header>
      </div>
    );
  }
}

export default App;
